(201, '21', '<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which packet-forwarding method does a router use to make switching decisions when it is using a forwarding information base and an adjacency table?</span></span></span></span></p>\r\n', '    fast switching    ', ' Cisco Express Forwarding  ', '   process switching    ', ' flow process', '', 2, '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Cisco Express Forwarding (CEF) is the fastest and preferred switching method. It uses a FIB and an adjacency table to perform the task of packet switching. These data structures change with the topology.</span></span></p>\r\n', '1.50', 'yes', '2023-04-04', '2023-04-04', '');
