(223, '23', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">___________is a collection of programs that enables users to create and maintain a database. </span></span></span></span></p>\r\n', 'Database system            ', 'ER diagram', 'Normalization ', 'DBMS', '', 4, '<p>A database management system (or DBMS) is essentially nothing more than&nbsp;<strong>a computerized data-keeping system</strong>. Users of the system are given facilities to perform several kinds of operations on such a system for either manipulation of the data in the database or the management of the database structure itself.</p>\r\n', '2.00', 'yes', '2023-04-04', '2023-04-04', ''),
(224, '23', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">___________is descriptions data in database with database structure, data types, and the constraints.</span></span></span></span></p>\r\n', 'ER	 diagram', 'Database state', 'Database schema', 'All', '', 3, '<p>In short, the database schema is&nbsp;<strong>a term used for a structure or layout defining a set of data</strong>. In other words, it describes how the data will be organized and connected. Hence, a database schema may include schema objects like tables, views, fields, relationships, packages, indexes, types, and many other elements.</p>\r\n', '2.00', 'yes', '2023-04-04', '2023-04-04', ''),
(225, '23', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which one of the following database language is used to provide user access privilege to the database?</span></span></span></span></p>\r\n', 'DML (Data manipulation  Language)         ', 'DCL(Data control  Language)', 'DDL(Data Definition Language)', 'All', '', 2, '<p>A data control language (DCL) is&nbsp;<strong>a syntax similar to a computer programming language used to control access to data stored in a database (authorization)</strong>.</p>\r\n', '2.00', 'yes', '2023-04-04', '2023-04-04', ''),
