(299, '24', '<p>Which of the following relation is correct?<br />\r\n&nbsp;</p>\r\n', 'Design Strength = Ultimate strength / Partial factor of safety', 'Design Strength = Ultimate strength + Partial factor of safety', 'Design Strength = Ultimate strength * Partial factor of safety', 'Design Strength = Ultimate strength – Partial factor of safety', '', 1, '', '1.00', 'yes', '2023-04-06', '2023-04-06', ''),
